DROP TABLE IF EXISTS `photo_likes`;

CREATE TABLE `photo_likes` (
  `photo_id` bigint(20) unsigned NOT NULL,
  `from_user_id` bigint(20) unsigned NOT NULL,
  `status` tinyint(1) DEFAULT NULL COMMENT 'true - like, false - dislike',
  `updated_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`photo_id`,`from_user_id`),
  KEY `from_user_id` (`from_user_id`),
  CONSTRAINT `photo_likes_ibfk_1` FOREIGN KEY (`photo_id`) REFERENCES `photos` (`id`),
  CONSTRAINT `photo_likes_ibfk_2` FOREIGN KEY (`from_user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: post_likes
#

DROP TABLE IF EXISTS `post_likes`;

CREATE TABLE `post_likes` (
  `post_id` bigint(20) unsigned NOT NULL,
  `from_user_id` bigint(20) unsigned NOT NULL,
  `status` tinyint(1) DEFAULT NULL COMMENT 'true - like, false - dislike',
  `updated_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`post_id`,`from_user_id`),
  KEY `from_user_id` (`from_user_id`),
  CONSTRAINT `post_likes_ibfk_1` FOREIGN KEY (`post_id`) REFERENCES `posts` (`id`),
  CONSTRAINT `post_likes_ibfk_2` FOREIGN KEY (`from_user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




